import React from 'react';

const CompleteButton = ({ action, value }) => {
    return (
        <form className="completed-checkbox">
            <label htmlFor={`checkbox-${value}`}>
                <input
                    id={`checkbox-${value}`}
                    name=""
                    value={value}
                    type="checkbox"
                    onClick={action}
                />
            </label>
        </form>
    );
}

export default CompleteButton;
